import React from "react";
import ReactDOM from "react-dom/client";

class Application extends React.Component {
	render () {
		return (
			<h1> I am a wrapper for whatever app goes here </h1>
		);
	}
}

class BarBottom extends React.Component {
  render () {
    return (
      <div>
				<h1> I am the bottom bar </h1>
				<div> {this.props.phone_number} </div>
			</div>
    );
  }
}

class BarTop extends React.Component {
	render () {
		return (
			<h1> I am the top bar </h1>
		);
	}
}

class Root extends React.Component {
	constructor (props) {
		super (props);
		this.phone_number = "Phone Number";
	}
	render () {
		return (
			<body>
				<BarTop />
				<Application />
				<BarBottom phone_number = {this.phone_number}/>
			</body>
		);
	}
}

const root = ReactDOM.createRoot (document.getElementById ("root"));
root.render (<Root />);
